import './App.css';
import Tile from './components/tile/Tile';
function App() {
  return (
    <div>
      <Tile tileArr={[['a', 'e']]}></Tile>
      <Tile tileArr={[['a']]}></Tile>
      <Tile tileArr={[['a', 'c','e'],[0, 0,'b']]}></Tile>
      <Tile tileArr={[['a', 0, 0], ['m', 'e', 0],[0, 'b', 'c']]}></Tile>
    </div>
  );
}

export default App;
